import {Component} from "react";

class MovieCard extends Component{
  render(){
    return (
        <div className="main">
            <div className="movie-card">
                <div className="left">

                <img alt="Poster"/> 
                </div>

                <div className="right">
                  <div className="title">
                    The Avengers
                  </div>

                </div>

            </div>
        </div>
    )
  }
}

export default MovieCard;
